#include <string.h>
#include <stdio.h>
#include <stdlib.h>

int main(void)
{
  //  char* st = "abcCBdeFfFg";
    char* st = "";
    int count = strlen(st);
    int low = count;
    char* s = malloc(sizeof(char)*count); //allocate memory for 2 strings in heap
    char* s2 = malloc(sizeof(char)*count);
    char* temp = NULL; //use for switching pointers each time around

    for(int i2=65; i2 < 91; i2++) //cycle through A-Z
    {
        strcpy(s,st);
        int diff = 1;
        int k = 0;
        //test for that char (upper and lower case)..
        for(int i=0; i<count+1; i++)
        {
            if(((int)s[i]==i2) || ((int)s[i]==i2+32)) //..and skip
            {
            }
            else
            {
                s2[k] = s[i]; //build new string without that char
                k++;
            }
        }
        s2[k] = '\0';
        //switcheroo pointers
        temp = s2;
        s2 = s;
        s = temp;
        //then reduce
        while(diff>0) //when strings are same length, no more reduction is possible
        {
            k=0;
            for(int i=0, j=strlen(s);i<j;i++)
            {
                if(abs(s[i]-s[i+1])==32) //loop through, looking for capitalised / non-capitalised pairs. Skip them.
                {
                    i++;
                }
                else
                {
                    s2[k] = s[i]; //build new string without pairs
                    k++;
                }
            }
            s2[k] = '\0';
            diff=strlen(s)-strlen(s2);
        //switcheroo pointers
            temp = s2;
            s2 = s;
            s = temp;
        }
        if(strlen(s)<low)
        {
            low = strlen(s);
        }
    }
    printf("Part 2: %i\n",low);
    free(s);
    free(s2);
}